//import styles from "./footer.module.css";

import { Link } from "react-router-dom";

const Footer = () => {
  return (
    <footer>
        <Link to="/Pokemons">
            <img src="/images/pokeball.png" alt="Pokeball" />
            Pokemons
        </Link>
        <Link to="/Pokemons">
            <img src="/images/pokeball.png" alt="Pokeball" />
            Item
        </Link>
        <Link to="/Pokemons">
            <img src="/images/pokeball.png" alt="Pokeball" />
            Map
        </Link>
    </footer>
  );
};

export default Footer;
